import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';
import Header from './components/header/header.jsx';
import Main_wrapper from './components/main-wrapper/Mainwrap';
import Coment from './components/comment/coment';
import { Route, BrowserRouter } from 'react-router-dom';
const App = (props) => {
  return (
    <>
      <BrowserRouter>
        <Header />
        <Route path={"/main-wrapper"} render={ () => <Main_wrapper newPostText={props.state.PostsData.newPostText} Posts={props.state.PostsData.Posts} dispatch={props.dispatch}/>} />
        <Route path={"/coment"} render={ () => <Coment newMessageBody={props.state.DialogsData.newMessageBody}Messages={props.state.DialogsData.Messages}  Dialogs={props.state.DialogsData.Dialogs} dispatch={props.dispatch}/>} />
      </BrowserRouter>
    </>
  );
}


export default App;
